      <text id="63" justification="0" size="4" underlined="false">
        <text>A UCD1+ syntax code can be got easily
using the static function: &lt;i&gt;get(char)&lt;/i&gt;.

function will return the following enum item:
 - &apos;P&apos; -&gt; PRIMARY
 - &apos;S&apos; -&gt; SECONDARY
 - &apos;Q&apos; -&gt; BOTH
 - &apos;E&apos; -&gt; PHOT_QUANTITY
 - &apos;C&apos; -&gt; COLOUR
